import React from "react";
import { View,Text } from "react-native";
import { StyleSheet } from "react-native";
const Login = () => {
  const test = [
    {
      id:1,
      nom:"Raharimanana",
      prenom:"Tianantenaina Fabiola"
    },
    {
      id:2,
      nom:"Raharimanana",
      prenom:"Herilalaina Stephanie"
    },
    {
      id:3,
      nom:"Raharimanana",
      prenom:"Heriniaina Sylvia"
    },
    {
      id:4,
      nom:"Rasoa",
      prenom:"Bozaka"
    }
  ]
  return (
    <View style={{flexDirection:"row", flex:1}}>
    <View style={{flex:1/6, backgroundColor:"green"}}>
    </View>
    <View style={{flex:1, backgroundColor:"#00bfa6", marginRight:10}}>
      <Text style={{paddingTop:30,paddingLeft:20}}>Menu</Text>
    </View>

    <View style={{flex:3, marginLeft:-10}}>
      <Text style={styles.title}>Bonjour</Text>
      <Text style={styles.subtitle}>Bienvenue sur le site</Text>
      {
        test.map(Test=>(
          <>
          <View style={styles.flex}>
            <View style={Test.id % 2 === 0 ? styles.red : styles.green}>
              <Text style={styles.textes}>{Test.nom}</Text>
              <Text style={styles.textes}>{Test.prenom}</Text>
            </View>
          </View>
          </>
        ))
      }
    </View>
    </View>
  );
};

const styles = StyleSheet.create({
  title: {
    fontSize: 36,
    marginTop: 10,
    color: "#00bfa6",
    textAlign: "center",
  },
  subtitle:{
    textAlign:"center",
    fontSize:24,
    padding:20
  },
  red:{
    backgroundColor:"red",
    padding:10,
    marginBottom:10,
    borderRadius:20,
  },
  green:{
    backgroundColor:"green",
    padding:10,
    marginBottom:10,
    borderRadius:20
  },
  textes:{
    color:"white",
    textAlign:"center"
  },
  flex:{
    display:"flex",
  }
});

export default Login;
